import React, { useState, memo } from "react"; // Added 'memo' to the import statement
import PropTypes from 'prop-types';
import {
  Grid,
  Paper,
  Typography,
  Box,
  Avatar,
  Divider,
  Container,
  ButtonBase,
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
  TextField,
  LinearProgress,
  Button,
} from "@mui/material";
import { styled } from "@mui/system";
import DirectionsRunIcon from '@mui/icons-material/DirectionsRun';
import theme from "../styles/theme";
import barbellIcon from "../Images/Login/23603572.png";
import ProgressBar from "../components/ProgressBar";
import WaterIntake from "../components/WaterIntake";

const MainContent = styled(Container)({
  padding: theme.spacing(3),
  backgroundColor: '#d2cfc9',
  maxWidth: '1400px',
  margin: 'auto',
  minHeight: '100vh',
});

const SquarePaperButton = styled(Paper)({
  width: '200px',
  height: '200px',
  padding: theme.spacing(2),
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  backgroundColor: theme.palette.background.paper,
  borderRadius: theme.shape.borderRadius,
});

const RectanglePaper = styled(Paper)({
  width: '416px',
  height: '200px',
  padding: theme.spacing(3),
  backgroundColor: theme.palette.background.paper,
  borderRadius: theme.shape.borderRadius,
});

const LargeRectanglePaper = styled(Paper)({
  width: '848px',
  height: '400px',
  padding: theme.spacing(3),
  backgroundColor: theme.palette.background.paper,
  borderRadius: theme.shape.borderRadius,
});

const HomePage = memo(() => {
  const [goalDialogOpen, setGoalDialogOpen] = useState(false); // Added state for goal dialog
  const [newGoal, setNewGoal] = useState(''); // Added state for new goal

  const handleOpenGoalDialog = () => {
    setGoalDialogOpen(true);
  };

  const handleCloseGoalDialog = () => {
    setGoalDialogOpen(false);
  };

  const handleAddGoal = () => {
    // Logic to add a new goal
    handleCloseGoalDialog();
  };

  return (
    <Box sx={{ backgroundColor: '#d2cfc9', minHeight: '100vh' }}>
      <MainContent>
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <Box display="flex" alignItems="center" mb={2}>
              <img src={barbellIcon} alt="Bulking Sensei" width="80" height="40" style={{ marginRight: theme.spacing(1) }} />
              <Typography variant="h6" sx={{ fontFamily: "Nanum Gothic, sans-serif" }}>
                Bulking Sensei
              </Typography>
            </Box>
          </Grid>

          <Grid item xs={12}>
            <LargeRectanglePaper elevation={3}>
              <Typography variant="h6">Statistics</Typography>
              {/* Add Statistics content here */}
            </LargeRectanglePaper>
          </Grid>
        </Grid>

        {/* Dialog for setting goals */}
        <Dialog open={goalDialogOpen} onClose={handleCloseGoalDialog}>
          <DialogTitle>Set a New Goal</DialogTitle>
          <DialogContent>
            <TextField
              autoFocus
              margin="dense"
              label="Goal Title"
              type="text"
              fullWidth
              value={newGoal}
              onChange={(e) => setNewGoal(e.target.value)}
            />
          </DialogContent>
          <DialogActions>
            <Button onClick={handleCloseGoalDialog} color="secondary">Cancel</Button>
            <Button onClick={handleAddGoal} color="primary">Add Goal</Button>
          </DialogActions>
        </Dialog>
      </MainContent>
    </Box>
  );
});

export default HomePage;
